import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './Pages.css';

const OrderHistory = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchOrders = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem('weKnowToken');

        if (!token) {
          setError('Please login to view your orders');
          setLoading(false);
          return;
        }

        const response = await axios.get('http://localhost:8000/user/orders', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        if (response.data.success) {
          console.log('Orders fetched successfully:', response.data.orders);
          setOrders(response.data.orders || []);
        } else {
          console.error('Failed to load orders:', response.data.error);
          setError(response.data.error || 'Failed to load orders');
        }
      } catch (err) {
        console.error('Error fetching orders:', err);
        console.error('Error response:', err.response?.data);
        if (err.response?.status === 401) {
          setError('Please login to view your orders');
        } else {
          setError('Failed to load orders. Please try again.');
        }
      } finally {
        setLoading(false);
      }
    };

    fetchOrders();
  }, []);

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ‚Üê Back to Home
        </Link>
        <h1>Order History</h1>
      </div>

      <div className="page-content">
        {loading ? (
          <div className="loading-state">
            <div className="loading-spinner"></div>
            <p>Loading your orders...</p>
          </div>
        ) : error ? (
          <div className="error-state">
            <div className="error-icon">‚ö†Ô∏è</div>
            <h3>Error Loading Orders</h3>
            <p>{error}</p>
            <button onClick={() => window.location.reload()} className="retry-button">
              Try Again
            </button>
          </div>
        ) : orders.length > 0 ? (
          <div className="orders-list">
            {orders.map((order) => (
              <div key={order.id} className="order-card">
                <div className="order-header">
                  <h3>{order.dish_name}</h3>
                  <span className={`status-badge ${(order.status || 'pending').toLowerCase()}`}>
                    {order.status || 'Pending'}
                  </span>
                </div>

                <div className="order-details">
                  <p><strong>Order ID:</strong> {order.id || 'N/A'}</p>
                  <p><strong>Date:</strong> {order.timestamp ? new Date(order.timestamp).toLocaleDateString() : 'N/A'}</p>
                  <p><strong>Servings:</strong> {order.servings || 2}</p>
                </div>

                <div className="ingredients-section">
                  <h4>Ingredients Delivered:</h4>
                  <div className="ingredients-tags">
                    {order.ingredients && order.ingredients.length > 0 ? (
                      order.ingredients.map((ingredient, index) => {
                        const quantity = ingredient.quantity;
                        const unit = ingredient.unit || '';
                        const name = ingredient.ingredient || ingredient.name || 'Unknown ingredient';

                        return (
                          <span key={index} className="ingredient-tag">
                            {quantity !== null ? `${quantity} ${unit} ` : ''}{name}
                          </span>
                        );
                      })
                    ) : (
                      <span className="ingredient-tag">No ingredients available</span>
                    )}
                  </div>
                </div>

                <div className="order-actions">
                  <button className="action-button">Reorder</button>
                  <button className="action-button secondary">View Details</button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">üì¶</div>
            <h3>No Orders Yet</h3>
            <p>Your completed orders will appear here</p>
            <Link to="/" className="cta-button">
              Start Your First Order
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default OrderHistory;
